//import {LoadUsers} from '../../../services/User/ProfileService'
import {LoadUsers} from '../../../services/User/AllUsersService'

export const loadUsersAction = () =>{
    return (dispatch)=>{

        dispatch({type:'LOADING'});

        LoadUsers().then((res)=>{

            if(res.hasOwnProperty('success') && res.success==true){
                console.log("dispatching allUsersactions")
                dispatch({type:'LOAD_USERS_SUCCESS',res});

            }else if(res.hasOwnProperty('success') && res.success==false) { 
                dispatch({type:'LOAD_USERS_ERROR',res})
            }
        },
        error=>{
            dispatch({type:'CODE_ERROR',error});
        }
        )
    }

}
